import { Box, CircularProgress } from "@mui/material";
import React from "react";

function LoadingScreen() {
    return (
        <Box
            sx={{
                position: "absolute",
                width: "100%",
                height: "100%",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
            }}
        >
   <CircularProgress color="danger" sx={{ size: 'lg' }}>
<CircularProgress color="danger" sx={{ size: 'md' }}/>
    </CircularProgress>
               
           
        </Box>
    );
}

export default LoadingScreen;
